<p><hi rend="bold">جياڭشى ئۆلكىسى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭخۇا_خەلق_جۇمھۇرىيىتى">جۇڭخۇا خەلق جۇمھۇرىيىتى</ref> دىكىبىخاھار 2004 نوپۇس بار، جياڭشىنىڭ 42،840،000 نوپۇسىبار، 166،900 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 27.37°، خارىكى ئۇزۇنلۇك 115°46.</p>
